import React from 'react';
import { BrowserRouter, BrowserRouter as Routes, Route, Switch} from "react-router-dom";
import Home from './pages/Home';
import Empreendedora from './pages/Empreendedora';
import './App.css';

function App() {
  return (

      <BrowserRouter>
      <Switch>
        <Route exact path="/" component={ <Home /> } />
        <Route path="/empreendedora" component={ <Empreendedora /> } />
        </Switch>
      </BrowserRouter>

  );
}

export default App;
